func isEnglish(str string) bool {
	reg := regexp.MustCompile(`^[a-zA-Z]+`)
	return reg.MatchString(str)
}

func isChinese(str string) bool {
	reg := regexp.MustCompile(`^[\p{Han}]+`)
	return reg.MatchString(str)
}

