func ReqProxySpeechTTSApi2(txt string) {
	header := buildSignHeader()
	header["baggage"] = "origin=VolcTTS"
	//header["traceparent"] = "abcdefg"

	var body VolcTTSRequest

	body = VolcTTSRequest{
		Txt:         txt,
		TxtType:     1,
		VoiceId:     "BV702_streaming",
		SpeedRatio:  0.9,
		PitchRatio:  1.1,
		volumeRatio: 1,
		AudioType:   "mp3",
		Oss:         false,
	}

	reqB, _ := json.Marshal(body)
	fmt.Println(string(reqB))
	resp, err := resty.New().SetRetryCount(0).
		SetTimeout(time.Second * time.Duration(10)).
		R().
		SetHeaders(header).
		SetBody(body).
		Post(ttsProxyUrl)
	fmt.Println(resp, err)
	if err != nil {
		fmt.Println("ChRequestBody err:", err)
		return
	}

	var ttsReply VolcTTSReply
	err = json.Unmarshal(resp.Body(), &ttsReply)
	if err != nil {
		fmt.Println("Unmarshal err:", err)
		return
	}
	fmt.Println(ttsReply)
	if len(ttsReply.Data.Tts) == 0 {
		return
	}

	pwd, _ := os.Getwd()
	err = ioutil.WriteFile(filepath.Join(pwd, "storageHS", txt+"."+body.AudioType), ttsReply.Data.Tts, fs.ModePerm)
	if err != nil {
		fmt.Println("WriteFile err:", err)
	}
}

