type VolcTTSRequest struct {
	Txt         string  `json:"txt,omitempty"`
	TxtType     int     `json:"txt_type,omitempty"`
	VoiceId     string  `json:"voice_id,omitempty"`
	SpeedRatio  float32 `json:"speed_ratio,omitempty"`
	PitchRatio  float32 `json:"pitch_ratio,omitempty"`
	volumeRatio int     `json:"volume_ratio,omitempty"`
	Oss         bool    `json:"oss,omitempty"`
	AudioType   string  `json:"audio_type,omitempty"`
}

type VolcTTSReply struct {
	ErrorReason string
	Data        struct {
		Tts []byte `json:"tts"`
	} `json:"data"`
	TtsUrl string `json:"tts_url"`
}

type SpeechTTSRequest struct {
	Txt         string  `json:"txt,omitempty"`
	TxtType     int     `json:"txt_type,omitempty"`
	VoiceId     string  `json:"voice_id,omitempty"`
	SampleRate  int     `json:"sample_rate,omitempty"`
	Speed       float32 `json:"speed,omitempty"`
	Volume      int     `json:"volume,omitempty"`
	PitchChange int     `json:"pitch_change,omitempty"`
	Language    string  `json:"language,omitempty"`
	Oss         bool    `json:"oss,omitempty"`
	AudioType   string  `json:"audio_type,omitempty"`
}

type SpeechTTSReply struct {
	ErrorCode   int
	ErrorMsg    string
	ErrorReason string
	Data        struct {
		Tts []byte `json:"tts"`
	} `json:"data"`
	TtsUrl string `json:"tts_url"`
}

func buildSignHeader() map[string]string {
	secretKey := "3ee3297885515618f6403173a045147f"
	//timestamp := strconv.FormatInt(time.Now().Unix(), 10)
	timestamp := strconv.FormatInt(time.Now().Unix(), 10)
	nonce := "postman_ae43caba82916a52aeb9ebf0e05d8cde4998"
	deviceId := "123456"
	sign := MD5(secretKey + "&X-Genie-Timestamp=" + timestamp + "&X-Genie-Nonce=" + nonce + "&X-Genie-DeviceId=" + deviceId)
	fmt.Println(sign)
	return map[string]string{
		"Content-Type":      "application/json",
		"X-Genie-TraceId":   uuid.New().String(),
		"X-Genie-DeviceId":  deviceId,
		"X-Genie-Timestamp": timestamp,
		"X-Genie-Nonce":     nonce,
		"X-Genie-AppId":     "200003",
		"X-Genie-Sign":      sign,
		"X-Genie-Version":   "V230223",
		"X-Genie-Osversion": "1.0.0",
		"X-Genie-Platform":  "web",
	}
}

func MD5(s string) string {
	sum := md5.Sum([]byte(s))
	return hex.EncodeToString(sum[:])
}

