func TestLen(t *testing.T) {
	str := "你好1234,34,about"
	fmt.Println(len(str))
	var buf bytes.Buffer
	for _, v := range str {
		buf.WriteRune(v)
	}

	fmt.Println(utf8.RuneCountInString(str))
	fmt.Println(utf8.RuneCount(buf.Bytes()))
}
